import React from 'react';
import { wallets } from '../Data/wallets';

const Wallets = () => {
	return (
		<div className='wallets'>
			<div className='wallets-top'>
				<h1>DebugDappNode</h1>
				<p>Decentralized Platform Wallet</p>
			</div>
			<div className="wallets-list-container">
				{
					wallets.map((singleWallet, index)=>{
						return (
							<div key={index} className="single-wallet">
								<img src={singleWallet.logo} alt="" />
								<p>{singleWallet.name}</p>
							</div>
						)
					})
				}
			</div>
			<div className="wallets-down">
				<p>Open an app submission issue on <span>GitHub</span> to add your app here.</p>
			</div>
		</div>
	);
};

export default Wallets;
